import React from 'react'
import { Container, Header } from 'semantic-ui-react';

const Home = () => {
  return (
    <Container>
      <Header as='h1'>Blog list app</Header>
      <p>Choose view from the menu bar</p>
    </Container>
  )
}

export default Home
